import React from 'react';
import "bootstrap/dist/css/bootstrap.min.css";
import "../src/App.css"
import { BrowserRouter as Router, Route} from "react-router-dom";

import Navbar from "./components/navbar.component"
import CollectionsList from "./components/collections-list/collections-list.component";
import EditCollections from "./components/edit-collections.component";
import CreateCollection from "./components/create-collection.component";
import CreateUser from "./components/create-user.component";

import Container from './views/maps-edit-container';
import Map from './views/Map/Map'
import Detail from './views/Detail/Detail'
// <Route path="/edit/:id" component={EditCollections} />
import PropTypes from 'prop-types'


class App extends React.Component {

  static contextTypes = {
    router: PropTypes.object
  }

  static propTypes = {
    history: PropTypes.object.isRequired,
    routes: PropTypes.element.isRequired
  };

  get content() {
    return (
      <Router
        routes={this.props.routes}
        history={this.props.history} />
    )
  }

  render () {
    //className="container"
    return (
      <Router>
        <div> 
          <Navbar />
          <div className="container">
            <Route path="/" component={Container}>
              <Route path="/view" exact component={CollectionsList} />
              <Route path="/edit" component={EditCollections} />
            </Route>

            <Route path="/create" component={CreateCollection} />
            <Route path="/user" component={CreateUser} />
            <Route path="detail/:placeId" component={Detail} />
          </div>
        </div>
      </Router>
    );
  }
}

export default App;
